import React from 'react';
import './App.css';

function App() {

  return (

    <div className="App">

      <div id="number-input">

        <input
          type="number"
          name="height"
          min="1"
          max="500"
        />

        <input
          type="number"
          name="width"
          min="1"
          max="500"
        />

      </div>

    </div>

  );

}

export default App;
